 de datos (DPO) en privacy@christiandior.com","it":"Christian Dior Couture\r\n\u00c8 inoltre possibile contattare il nostro Data Protection Officer (DPO) all'indirizzo: privacy@christiandior.com ","nl":"Christian Dior Couture \r\nU kunt op het volgende adres ook contact opnemen met de afdeling voor gegevensbescherming: privacy@christiandior.com. ","ru":"Christian Dior Couture \r\n\u0412\u044b \u0442\u0430\u043a\u0436\u0435 \u043c\u043e\u0436\u0435\u0442\u0435 \u043e\u0431\u0440\u0430\u0442\u0438\u0442\u044c\u0441\u044f \u043a \u043d\u0430\u0448\u0435\u043c\u0443 \u0443\u043f\u043e\u043b\u043d\u043e\u043c\u043e\u0447\u0435\u043d\u043d\u043e\u043c\u0443 \u043f\u043e \u0437\u0430\u0449\u0438\u0442\u0435 \u0434\u0430\u043d\u043d\u044b\u0445 \u043f\u043e \u0430\u0434\u0440\u0435\u0441\u0443 privacy@christiandior.com ","cn":"Christian Dior Couture \r\n\u60a8\u8fd8\u53ef\u53d1\u9001\u7535\u5b50\u90ae\u4ef6\u81f3privacy@christiandior.com\uff0c\u8054\u7cfb\u6211\u4eec\u7684\u6570\u636e\u4fdd\u62a4\u4e13\u5458\u3002 ","ja":"\u30af\u30ea\u30b9\u30c1\u30e3\u30f3 \u30c7\u30a3\u30aa\u30fc\u30eb \u30af\u30c1\u30e5\u30fc\u30eb \r\n\u4ee5\u4e0b\u306e\u30a2\u30c9\u30ec\u30b9\u304b\u3089\u3001\u30c7\u30fc\u30bf\u4fdd\u8b77\u306b\u95a2\u3057\u3066\u5f0a\u793e\u4ee3\u8868\u8005\u306b\u304a\u554f\u3044\u5408\u308f\u305b\u3044\u305f\u3060\u304f\u3053\u3068\u3082\u53ef\u80fd\u3067\u3059\uff1aprivacy@christiandior.com ","ko":"\ud06c\ub9ac\uc2a4\ucc64 \ub514\uc62c \uafb8\ub6f0\ub974 \r\nprivacy@christiandior.com\uc744 \ud1b5\ud574 \uac1c\uc778\uc815\ubcf4 \ubcf4\uc548 \ucc45\uc784\uc790\uc5d0\uac8c \ubb38\uc758\ud558\uc2e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4. ","tw":"Christian Dior Couture \r\n\u60a8\u9084\u53ef\u767c\u9001\u96fb\u5b50\u90f5\u4ef6\u81f3privacy@christiandior.com\uff0c\u806f\u7e6b\u6211\u5011\u7684\u8cc7\u6599\u4fdd\u8b77\u5c08\u54e1\u3002 "},"livechat.conversations.consent.legal.yourRights":{"fr":"Droits inconditionnels\r\nA tout moment, vous pouvez :\r\n * Rectifier vos donn\u00e9es personnelles\r\n * Obtenir une copie de ces donn\u00e9es personnelles\r\n\r\nDroits conditionnels\r\nLe cas \u00e9ch\u00e9ant, vous pouvez :\r\n * Retirer votre consentement lorsque notre utilisation est bas\u00e9e sur les caract\u00e9ristiques pr\u00e9c\u00e9dentes\r\n * Demander le transfert \u00e0 quiconque des donn\u00e9es que nous d\u00e9tenons sur la base de votre consentement\r\n * Demander que nous conservions vos donn\u00e9es sans les utiliser en cas d'inexactitude, d'ill\u00e9galit\u00e9, pendant que nous examinons votre refus d'utiliser vos donn\u00e9es ou si vous en avez besoin devant les tribunaux\r\n * Demander la suppression des donn\u00e9es dans le cas o\u00f9 elles ne sont pas n\u00e9cessaires ou si vous retirez votre consentement\r\n\r\nEnfin, vous pouvez pr\u00e9senter une demande aupr\u00e8s de l'autorit\u00e9 de protection des donn\u00e9es de votre pays.","en":"Unconditional rights\r\nAt any time, you may:\r\n * Rectify your personal data\r\n * Obtain a copy of such personal data\r\n\r\nConditional rights\r\nAs the case may be, you may:\r\n * Withdraw your consent where one of our use is based hereupon\r\n * Request the transfer to anyone of data we hold on the basis of your consent\r\n * Request that we keep your data without using it in case of inaccuracy, unlawfulness, while we examine your refusal that we use your data or should you need if before courts\r\n * Request deletion in case data is unnecessary or where you have withdrawn consent \r\n \r\nFinally, you may introduce a claim with the data protection authority of your country.","de":"Uneingeschr\u00e4nkte Rechte\r\nSie haben jederzeit die M\u00f6glichkeit:\r\n * Ihre personenbezogenen Daten zu korrigieren\r\n * Eine Kopie dieser personenbezogenen Daten zu erhalten\r\n\r\nEingeschr\u00e4nkte Rechte\r\nGegebenenfalls k\u00f6nnen Sie:\r\n * Ihre Zustimmung in Verbindung mit einem unserer Verwendungszwecke zur\u00fcckziehen\r\n * Die \u00dcbertragung der Daten, die wir auf der Grundlage Ihrer Zustimmung besitzen, an einen Dritten verlangen\r\n * Verlangen, dass wir Ihre Daten aufbewahren, ohne sie zu verwenden, im Falle von Ungenauigkeiten, Rechtswidrigkeiten, w\u00e4hrend wir Ihre Ablehnung bez\u00fcglich der Verwendung Ihrer Daten pr\u00fcfen oder falls Sie sie vor Gericht ben\u00f6tigen\r\n * Die L\u00f6schung von unn\u00f6tigen Daten oder von solchen verlangen, f\u00fcr die Sie Ihre Zustimmung zur\u00fcckgezogen haben\r\n\r\nUnd schlie\u00dflich k\u00f6nnen Sie eine Klage bei der Datenschutzbeh\u00f6rde Ihres Landes einreichen.","es":"Derechos incondicionales\r\nCuando quiera, puede:\r\n * Corregir sus datos personales\r\n * Obtener una copia de esos datos personales\r\n\r\nDerechos condicionales\r\nSi procede, puede:\r\n * Retirar su consentimiento para alguno de los usos aqu\u00ed indicados.\r\n * Solicitar la cesi\u00f3n de los datos que guardamos bajo su autorizaci\u00f3n.\r\n * Solicitar que guardemos sus datos sin hacer uso de ellos en caso de imprecisi\u00f3n o ilegalidad mientras examinamos su rechazo a que utilicemos sus datos o si lo necesita ante los tribunales.\r\n * Solicitar la eliminaci\u00f3n si los datos son innecesarios o donde haya retirado su consentimiento.\r\n \r\nPor \u00faltimo, puede realizar una solicitud a trav\u00e9s de la autoridad de protecci\u00f3n de datos de su pa\u00eds.","it":"Diritti incondizionati \r\nIn qualunque momento potrai: \r\n - Rettificare i tuoi dati personali \r\n- Ottenere una copia di tali dati personali \r\n \r\nDiritti condizionati \r\nQualora opportuno potrai: \r\n - Rifiutare il tuo consenso a uno dei nostri utilizzi in conseguenza di tale regolamento \r\n- Richiedere il trasferimento di dati in nostro possesso sulla base del tuo consenso a chiunque tu voglia \r\n- Richiedere che conserviamo i tuoi dati senza utilizzarli in caso di non correttezza, illegalit\u00e0, mentre esaminiamo il tuo rifiuto all'utilizzo dei tuoi dati da parte nostra o se dovessimo averne bisogno in tribunale \r\n- Richiederne la cancellazione nel caso in cui i dati non siano necessari o tu abbia rifiutato il tuo consenso \r\n \r\nInfine, hai la possibilit\u00e0 di sporgere reclamo presso l'autorit\u00e0 per la protezione dei dati del tuo paese. ","nl":"Onvoorwaardelijke rechten \r\nU kunt op elk moment: \r\n- Uw persoonlijke gegevens rechtzetten \r\n- Een kopie van dergelijke persoonlijke gegevens verkrijgen \r\n \r\nVoorwaardelijke rechten \r\nDesgevallend kunt u: \r\n- Uw toestemming intrekken indien ons gebruik daarop is gebaseerd \r\n- Vragen dat gegevens die we bijhouden op basis van uw toestemming worden overgedragen aan om het even wie \r\n- Vragen dat we uw gegevens bijhouden zonder deze te gebruiken in geval van onjuistheid, onwettigheid, terwijl we uw weigering dat we uw gegevens zouden gebruiken onderzoeken of indien nodig voor de rechtbank \r\n- Verwijdering vragen indien gegevens onnodig zijn of indien u uw toestemming hebt ingetrokken \r\n \r\nTot slot kunt u een vordering indienen bij de autoriteit voor gegevensbescherming van uw land. ","ru":"\u0411\u0435\u0437\u0443\u0441\u043b\u043e\u0432\u043d\u044b\u0435 \u043f\u0440\u0430\u0432\u0430\r\n\u0412 \u043b\u044e\u0431\u043e\u0439 \u043c\u043e\u043c\u0435\u043d\u0442 \u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435:\r\n * \u0432\u043d\u0435\u0441\u0442\u0438 \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0432 \u0412\u0430\u0448\u0438 \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0435 \u0434\u0430\u043d\u043d\u044b\u0435\r\n * \u0437\u0430\u043f\u0440\u043e\u0441\u0438\u0442\u044c \u043a\u043e\u043f\u0438\u044e \u0412\u0430\u0448\u0438\u0445 \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0445 \u0434\u0430\u043d\u043d\u044b\u0445\r\n\r\n\u0423\u0441\u043b\u043e\u0432\u043d\u044b\u0435 \u043f\u0440\u0430\u0432\u0430\r\n\u041f\u0440\u0438 \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e\u0441\u0442\u0438 \u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435:\r\n * \u043e\u0442\u043e\u0437\u0432\u0430\u0442\u044c \u0441\u0432\u043e\u0435 \u0441\u043e\u0433\u043b\u0430\u0441\u0438\u0435 \u043d\u0430 \u043e\u0431\u0440\u0430\u0431\u043e\u0442\u043a\u0443 \u0434\u0430\u043d\u043d\u044b\u0445, \u0432 \u0441\u043b\u0443\u0447\u0430\u0435 \u0435\u0441\u043b\u0438 \u0438\u0445 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435 \u043d\u0430\u043c\u0438 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u043e \u043d\u0430 \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u0430\u0445, \u0443\u043a\u0430\u0437\u0430\u043d\u043d\u044b\u0445 \u0432\u044b\u0448\u0435;\r\n * \u0441\u0434\u0435\u043b\u0430\u0442\u044c \u0437\u0430\u043f\u0440\u043e\u0441 \u043d\u0430 \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0443 \u043a\u043e\u043c\u0443-\u043b\u0438\u0431\u043e \u0412\u0430\u0448\u0438\u0445 \u0434\u0430\u043d\u043d\u044b\u0445, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043d\u0430\u0445\u043e\u0434\u044f\u0442\u0441\u044f \u0432 \u043d\u0430\u0448\u0435\u043c \u0440\u0430\u0441\u043f\u043e\u0440\u044f\u0436\u0435\u043d\u0438\u0438 \u0441 \u0412\u0430\u0448\u0435\u0433\u043e \u0441\u043e\u0433\u043b\u0430\u0441\u0438\u044f;\r\n * \u0441\u0434\u0435\u043b\u0430\u0442\u044c \u0437\u0430\u043f\u0440\u043e\u0441 \u043d\u0430 \u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u0435 \u0412\u0430\u0448\u0438\u0445 \u0434\u0430\u043d\u043d\u044b\u0445 \u0431\u0435\u0437 \u0438\u0445 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u0441 \u043d\u0430\u0448\u0435\u0439 \u0441\u0442\u043e\u0440\u043e\u043d\u044b \u0432 \u0441\u043b\u0443\u0447\u0430\u0435 \u0438\u0445 \u043d\u0435\u0442\u043e\u0447\u043d\u043e\u0441\u0442\u0438 \u0438\u043b\u0438 \u043f\u0440\u043e\u0442\u0438\u0432\u043e\u0440\u0435\u0447\u0438\u044f \u0437\u0430\u043a\u043e\u043d\u0443 \u043d\u0430 \u043f\u0435\u0440\u0438\u043e\u0434 \u0438\u0437\u0443\u0447\u0435\u043d\u0438\u044f \u0441 \u043d\u0430\u0448\u0435\u0439 \u0441\u0442\u043e\u0440\u043e\u043d\u044b \u0412\u0430\u0448\u0435\u0433\u043e \u043e\u0442\u043a\u0430\u0437\u0430 \u043d\u0430 \u043e\u0431\u0440\u0430\u0431\u043e\u0442\u043a\u0443 \u0412\u0430\u0448\u0438\u0445 \u0434\u0430\u043d\u043d\u044b\u0445, \u0438\u043b\u0438 \u0435\u0441\u043b\u0438 \u0443 \u0412\u0430\u0441 \u0432\u043e\u0437\u043d\u0438\u043a\u043b\u0430 \u0442\u0430\u043a\u0430\u044f \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e\u0441\u0442\u044c \u0432 \u0441\u0443\u0434\u0435\u0431\u043d\u043e\u043c \u043f\u043e\u0440\u044f\u0434\u043a\u0435;\r\n * \u0441\u0434\u0435\u043b\u0430\u0442\u044c \u0437\u0430\u043f\u0440\u043e\u0441 \u043d\u0430 \u0443\u0434\u0430\u043b\u0435\u043d\u0438\u0435 \u0434\u0430\u043d\u043d\u044b\u0445, \u0435\u0441\u043b\u0438 \u0432 \u043d\u0438\u0445 \u043d\u0435\u0442 \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e\u0441\u0442\u0438, \u0438\u043b\u0438 \u0432 \u0441\u043b\u0443\u0447\u0430\u0435 \u043e\u0442\u0437\u044b\u0432\u0430 \u0412\u0430\u0448\u0435\u0433\u043e \u0441\u043e\u0433\u043b\u0430\u0441\u0438\u044f \u043d\u0430 \u043e\u0431\u0440\u0430\u0431\u043e\u0442\u043a\u0443 \u0434\u0430\u043d\u043d\u044b\u0445.\r\n\r\n\u0412\u044b \u0442\u0430\u043a\u0436\u0435 \u0438\u043c\u0435\u0435\u0442\u0435 \u043f\u0440\u0430\u0432\u043e \u043e\u0431\u0440\u0430\u0442\u0438\u0442\u044c\u0441\u044f \u0432 \u0443\u043f\u043e\u043b\u043d\u043e\u043c\u043e\u0447\u0435\u043d\u043d\u044b\u0439 \u043e\u0440\u0433\u0430\u043d \u043f\u043e \u0437\u0430\u0449\u0438\u0442\u0435 \u043f\u0440\u0430\u0432 \u0441\u0443\u0431\u044a\u0435\u043a\u0442\u043e\u0432 \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0445 \u0434\u0430\u043d\u043d\u044b\u0445 \u0441\u0432\u043e\u0435\u0439 \u0441\u0442\u0440\u0430\u043d\u044b.","cn":"\u65e0\u6761\u4ef6\u6743\u9650\r\n\u5728\u4efb\u4f55\u65f6\u5019\uff0c\u60a8\u90fd\u53ef\u4ee5\uff1a\r\n * \u66f4\u6539\u60a8\u7684\u4e2a\u4eba\u4fe1\u606f\r\n * \u7d22\u53d6\u60a8\u4e2a\u4eba\u4fe1\u606f\u7684\u526f\u672c\r\n\r\n\u6709\u6761\u4ef6\u6743\u9650\r\n\u5728\u6b64\u60c5\u51b5\u4e0b\uff0c\u60a8\u53ef\u4ee5\uff1a\r\n * \u5728\u57fa\u4e8e\u4e0a\u8ff0\u7279\u5f81\u7684\u4f7f\u7528\u60c5\u51b5\u4e0b\uff0c\u64a4\u9500\u60a8\u7684\u540c\u610f\r\n * \u8981\u6c42\u5411\u5176\u4ed6\u4efb\u4f55\u4eba\u8f6c\u53d1\u6211\u4eec\u83b7\u5f97\u60a8\u540c\u610f\u7684\u524d\u63d0\u4e0b\u4fdd\u5b58\u7684\u4e2a\u4eba\u4fe1\u606f\r\n * \u8981\u6c42\u5728\u4fe1\u606f\u4e0d\u51c6\u786e\u3001\u4e0d\u5408\u6cd5\u7684\u60c5\u51b5\u4e0b\uff0c\u5728\u6211\u4eec\u5ba1\u6838\u60a8\u62d2\u7edd\u4f7f\u7528\u60a8\u4e2a\u4eba\u4fe1\u606f\u7684\u8bf7\u6c42\u6216\u60a8\u5e0c\u671b\u5728\u51fa\u5ead\u4f7f\u7528\u6b64\u4fe1\u606f\u7684\u60c5\u51b5\u4e0b\uff0c\u4fdd\u5b58\u4f46\u4e0d\u4f7f\u7528\u60a8\u7684\u4e2a\u4eba\u4fe1\u606f\r\n * \u5728\u4e0d\u9700\u8981\u4e2a\u4eba\u4fe1\u606f\u6216\u60a8\u64a4\u9500\u540c\u610f\u7684\u60c5\u51b5\u4e0b\uff0c\u8981\u6c42\u5220\u9664\u8fd9\u4e9b\u4e2a\u4eba\u4fe1\u606f\r\n\r\n\u6700\u540e\uff0c\u60a8\u53ef\u4ee5\u5411\u60a8\u6240\u5728\u56fd\u5bb6\/\u5730\u533a\u7684\u6570\u636e\u4fdd\u62a4\u673a\u6784\u63d0\u51fa\u7533\u8bf7\u3002","ja":"\u7121\u6761\u4ef6\u306e\u6a29\u5229\r\n\u3044\u3064\u3067\u3082\u3042\u306a\u305f\u306f\uff1a \r\n\r\n\u2212 \u3042\u306a\u305f\u306e\u500b\u4eba\u60c5\u5831\u3092\u5909\u66f4\u3067\u304d\u307e\u3059 \r\n\u2212 \u305d\u308c\u3089\u306e\u500b\u4eba\u60c5\u5831\u306e\u30b3\u30d4\u30fc\u3092\u5165\u624b\u3067\u304d\u307e\u3059\r\n\r\n\u6761\u4ef6\u4ed8\u304d\u6a29\u5229 \r\n\u5fc5\u8981\u306b\u5fdc\u3058\u3066\u3001\u4ee5\u4e0b\u306e\u3053\u3068\u304c\u3067\u304d\u307e\u3059\uff1a\r\n\r\n\u2212 - \u79c1\u305f\u3061\u306e\u4f7f\u7528\u304c\u4ee5\u524d\u306e\u6a5f\u80fd\u306b\u57fa\u3065\u3044\u3066\u3044\u308b\u5834\u5408\u306f\u3001\u540c\u610f\u3092\u64a4\u56de\u3059\u308b\r\n- \u3042\u306a\u305f\u306e\u540c\u610f\u306b\u57fa\u3065\u3044\u3066\u3001\u79c1\u305f\u3061\u304c\u4fdd\u6301\u3059\u308b\u30c7\u30fc\u30bf\u306e\u8ab0\u304b\u3078\u306e\u8ee2\u9001\u3092\u8981\u6c42\u3059\u308b\u3002\r\n- \u3042\u306a\u305f\u304c\u30c7\u30fc\u30bf\u306e\u4f7f\u7528\u3092\u62d2\u5426\u3057\u305f\u5834\u5408\u3001\u307e\u305f\u306f\u88c1\u5224\u6240\u3067\u5fc5\u8981\u306a\u5834\u5408\u306f\u3001\u30c7\u30fc\u30bf\u304c\u4e0d\u6b63\u78ba\u3001\u9055\u6cd5\u306a\u5834\u5408\u306b\u3001\u30c7\u30fc\u30bf\u3092\u4f7f\u7528\u305b\u305a\u306b\u4fdd\u5b58\u3059\u308b\u3088\u3046\u306b\u8981\u8acb\u3059\u308b\u3002\r\n- \u5fc5\u8981\u304c\u306a\u3044\u5834\u5408\u3084\u3001\u540c\u610f\u3092\u53d6\u308a\u6d88\u3059\u5834\u5408\u306f\u3001\u30c7\u30fc\u30bf\u306e\u524a\u9664\u3092\u30ea\u30af\u30a8\u30b9\u30c8\u3059\u308b\u3002 \r\n\r\n\u6700\u5f8c\u306b\u3001\u3042\u306a\u305f\u306e\u56fd\u306e\u30c7\u30fc\u30bf\u4fdd\u8b77\u6a5f\u95a2\u306b\u7533\u8acb\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002","ko":"\ubb34\uc870\uac74\uc801 \uad8c\ub9ac \r\n\uc5b8\uc81c\ub4e0 \uc6d0\ud558\uc2e4 \ub54c\uc5d0: \r\n* \uadc0\ud558\uc758 \uac1c\uc778 \uc815\ubcf4\ub97c \uc218\uc815\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4 \r\n* \ud2b9\uc815 \uac1c\uc778 \uc815\ubcf4\uc758 \uc0ac\ubcf8\uc744 \uc694\uad6c\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4 \r\n\r\n\uc870\uac74\uc801 \uad8c\ub9ac \r\n\uacbd\uc6b0\uc5d0 \ub530\ub77c:\r\n*\uadc0\ud558\uc758 \uc815\ubcf4 \uc0ac\uc6a9\uc5d0 \ub300\ud55c \ub3d9\uc758 \uc5ec\ubd80\ub97c \ucca0\ud68c\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4 \r\n* \uadc0\ud558\uc758 \ub3d9\uc758\uc5d0 \ub530\ub77c \ub2f9\uc0ac\uc5d0\uc11c \ubcf4\uc720\ud558\uace0 \uc788\ub294 \uc815\ubcf4\ub97c \ub2e4\ub978 \uc774\uc5d0\uac8c \uc804\ub2ec\ud560 \uac83\uc744 \uc694\uccad\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4 \r\n* \uadc0\ud558\uc758 \ub370\uc774\ud130 \uc0ac\uc6a9\uc5d0 \ub300\ud55c \uac70\uc808 \uac74\uc5d0 \ub300\ud558\uc5ec \uac80\ud1a0\ud558\uac70\ub098 \uc18c\uc1a1 \uc804\uc5d0 \ud544\uc694\ud55c \uae4c\ub2ed\uc73c\ub85c, \uc624\ub958 \ubc0f \ubd88\ubc95\uc801\uc7